INSERT INTO `field_data_field_resumen` VALUES ('bean','actividad_block',0,1,24,'und',0,'<ul>\r\n	<li>Lee detenidamente los <a class=\"ctools-use-modal\" href=\"modal_forms/nojs/webform/3\">términos y condiciones</a> antes de participar.</li>\r\n	<li>Graba un video de máximo 30 segundos imitando los movimientos de nuestro tutorial.</li>\r\n	<li>Pídele a un adulto responsable que te ayude a subirlo y a completar los datos de nuestro formulario entre el 1 y el 13 de marzo de 2018.</li>\r\n	<li>Si eres 1 de los 12 seleccionados por nuestro jurado, podrás viajar a Guadalajara-México con un acompañante para representar a Colombia en los Tryouts Nissan y así participar por un viaje a la final de la UEFA Champions League 2018 en Kiev-Ucrania.</li>\r\n</ul>\r\n','filtered_html');
